const SearchBox = (props) => {
    return (
        <div className="col col-sm-4">
            <input 
                className="form-control" 
                value={props.value}
                onChange={ (event) => props.setSearchValue(event.target.value)}
                placeholder="Rechercher un film"
            />    
        </div>
    )
}

export default SearchBox;
